declare(strict_types = 1);

namespace iOTADevs\Turrets;

use pocketmine\block\BlockFactory;
use pocketmine\entity\Entity;
use pocketmine\event\Listener;
use pocketmine\level\Level;
use pocketmine\math\Vector3;
use pocketmine\nbt\tag\CompoundTag;
use pocketmine\nbt\tag\DoubleTag;
use pocketmine\nbt\tag\FloatTag;
use pocketmine\nbt\tag\ListTag;
use pocketmine\nbt\tag\StringTag;
use pocketmine\plugin\PluginBase;
use pocketmine\resourcepacks\ZippedResourcePack;
use pocketmine\utils\Config;

class Main extends PluginBase implements Listener {

	/** @var Config */
	private $config;

	public static $lookRadius = 15;
	public static $shootRadius = 10;
	public static $shootPerTick = 10;
	public static $mode = "Standalone";

	/** @var CompoundTag */
	private static $SKIN_DATA = null;

	public function onLoad(){
		if(!is_dir($this->getDataFolder())){
			@mkdir($this->getDataFolder());
		}
		$this->saveDefaultConfig();
		$this->config = new Config($this->getDataFolder() . "config.yml", Config::YAML);
		$this->loadResources();

		self::$lookRadius = $this->config->get("lookRadius", 15);
		self::$shootRadius = $this->config->get("shootRadius", 10);
		self::$shootPerTick = $this->config->get("shootPerTick", 10);
		self::$mode = $this->config->get("mode", 10);
	}

	public function onEnable(){
		$this->getLogger()->info("Turret plugin Enabled!");

		Entity::registerEntity(TurretEntity::class, true, ['Turret', 'minecraft:turret']);
		Entity::registerEntity(LaserEntity::class, true, ['Laser', 'minecraft:laser']);
		if(strtolower(self::$mode) == "standalone"){
			BlockFactory::registerBlock(new TurretSpawnBlock(), true);
		}
		$this->getServer()->getPluginManager()->registerEvents($this, $this);
	}

	public static function spawnTurret(Vector3 $pos, Level $level, array $friends = []){
		$nbt = new CompoundTag("", [
			new ListTag("Pos", [
				new DoubleTag("", $pos->getX()),
				new DoubleTag("", $pos->getY() + 1),
				new DoubleTag("", $pos->getZ()),
			]),
			new ListTag("Motion", [
				new DoubleTag("", 0.0),
				new DoubleTag("", 0.0),
				new DoubleTag("", 0.0),
			]),
			new ListTag("Rotation", [
				new FloatTag("", 0),
				new FloatTag("", 0),
			]),
		]);
		$nbt->friends = new StringTag("friends", json_encode($friends));
		$nbt->Skin = clone self::$SKIN_DATA;

		/** @var TurretEntity $turret */
		$turret = Entity::createEntity("Turret", $level, $nbt);
		$turret->setNameTag("Turret");
		$turret->spawnToAll();
	}

